INSERT INTO `brand` (`brandid`, `brandname`, `brandimage`, `decs`) VALUES
(1000, 'ferrari', 'data:image/jpeg;base64,', 'Ferrari S.p.A. is an Italian sports car manufacturer based in Maranello. Founded by Enzo Ferrari in 1939 as Auto Avio Costruzioni, the company built its first car in 1940. However, the company''s inception as an auto manufacturer is usually recognized in 1947 when the first Ferrari-badged car was completed.\r\n\r\nFerrari is the world''s most powerful brand according to Brand Finance. In May 2012 the 1962 Ferrari 250 GTO became the most expensive car in history, selling in a private transaction for $38,115,000 to American communications magnate Craig McCaw.\r\n\r\nFiat S.p.A. acquired 50% of Ferrari in 1969 and expanded its stake to 90% in 1988. In October 2014 Fiat Chrysler Automobiles announced its intentions to separate Ferrari from FCA; as of the announcement FCA owned 90% of Ferrari. The separation began in October 2015 with a restructuring that established Ferrari N.V. (a company incorporated in the Netherlands) as the new holding company of the Ferrari group and the subsequent sale by FCA of a 10% of the shares in an IPO and concurrent listing of common shares on the New York Stock Exchange. Through the remainings steps of the separation, FCA''s interest in Ferrari''s business was distributed to shareholders of FCA, with a 10% continuing to be owned by Piero Ferrari. The spin-off was completed on January 3, 2016.\r\n\r\nThroughout its history, the company has been noted for its continued participation in racing, especially in Formula One, where it is the most successful racing team, holding the most constructors championships (16) and having produced the highest number of winning drivers (15).[12] Ferrari road cars are generally seen as a symbol of speed, luxury and wealth.[13]');
INSERT INTO `brand` (`brandid`, `brandname`, `brandimage`, `decs`) VALUES
(1001, 'audi', 'data:image/jpeg;base64,', 'Audi is a luxury car manufacturer established in 1910, with its headquarters in Ingolstadt, Germany. The company derives its name from the surname of its founder August Horch, meaning listen — which, when translated into Latin, becomes Audi.\r\n\r\nAfter being forced out of the company he had founded in 1909, Horch, then started a new company in Zwickau and continued using the Horch brand. The first Audi automobile, the Audi Type A 10/22 hp (16 kW) Sport-Phaeton, was produced in 1910 in Zwickau. His former partners sued him for trademark infringement and the German Supreme Court (Reichsgericht in Berlin) finally determined that the Horch brand belonged to his former company.\r\n\r\nAugust Horch was barred from using his own family name in his new car business, so he met with his best business friends, Paul and Franz Fikentscher from Zwickau. At Fikentscher’s apartment, they discussed how to come up with a new name for the company. During this meeting Fikentscher’s son was quietly studying Latin in a corner of the room. Several times he looked like he wanted to say something but couldn’t, until he finally blurted out, "Father - audiatur et altera pars... wouldn''t it be a good idea to call it Audi instead of horch?" "Horch!" in German means "Hark!" or "hear", which is "Audi" in Latin. The idea was enthusiastically accepted by everyone attending the meeting.\r\n\r\nHorch left Audi in 1920 for a higher position at the ministry of transport, but was still involved with Audi as a member of the board of trustees. In September 1921, Audi became the first German car manufacturer to present a production car, the Audi Type K, with left-handed drive.\r\n\r\nMotorsports Heritage\r\n\r\nAudi cars were successful even in sporting events. Audi has competed in numerous forms of motorsports. Audi’s rich tradition in motorsport began with their former company Auto Union in the 1930s. In the 1990s, Audi dominated the Touring and Super Touring categories of motor racing after success in circuit racing in North America.\r\n\r\nIn 1980, Audi released the Quattro, a four-wheel drive (4WD) turbocharged car that went on to win rallies and races worldwide. It is considered one of the most significant rally cars of all time, because it was one of the first to take advantage of the then-recently changed rules which allowed the use of four-wheel drive in competition racing. Many critics doubted the viability of four-wheel drive racers, thinking them to be too heavy and complex, yet the Quattro was to become a successful car. Leading its first rally it went off the road, however the rally world had been served notice, 4WD was the future. The Quattro went on to achieve much success in the World Rally Championship.\r\n\r\nThe carmaker became a subsidiary of automobile giant Volkswagen Group in 1964. Today, it has production locations in a number of countries, including Hungary, Brazil, Belgium and China.\r\n\r\nAudi India\r\n\r\nAudi came to India and set up its own sales company in 2007. With the aim to cater to the rich consumers, Audi entered the Indian automobile business and began its operations as a subsidiary of Mumbai-based Volkswagen Group Sales India Pvt. Ltd. Audi, currently assembles most of its vehicles in India. These cars are brought through the Completely Knocked Down kits (CKD) and assembled at the Aurangabad facility of Skoda, while a few models are imported as Completely Built Units (CBU).\r\n\r\nBy establishing Audi India as a Division of Volkswagen Group Sales India Pvt. Ltd. in Mumbai, Audi has made a clear long-term statement in the country with ambitious growths plans. Audi is currently leading the luxury vehicles segment in India when it comes to sales. The company has an enviable range of SUVs, sedans and sports cars.\r\n\r\n');
INSERT INTO `brand` (`brandid`, `brandname`, `brandimage`, `decs`) VALUES
(1002, 'ford', 'data:image/jpeg;base64,', 'The Ford Motor Company is an American multinational corporation based in Dearborn, Michigan, a suburb of Detroit and is the world''''s second largest automaker with approximately 350,000 employees, operating in more than 200 markets on six continents. The automaker was founded by Henry Ford and incorporated on June 16, 1903. In addition to the Ford, Lincoln, and Mercury brands, it also owns a small stake in Mazda in Japan and Aston Martin in the UK. Ford''''s former UK subsidiaries Jaguar and Land Rover were sold to Tata Motors of India in March 2008.\r\n\r\nFord introduced methods for large-scale manufacturing of cars and large-scale management of an industrial workforce using elaborately engineered manufacturing sequences typified by moving assembly lines. Henry Ford''''s methods came to be known around the world as Fordism by 1914.\r\n\r\nFord is currently the second largest automaker in the U.S. and the fourth-largest in the world based on number of vehicles sold annually, directly behind Volkswagen Group. In 2007, the company fell from second to third in US annual vehicle sales for the first time in 56 years, behind only General Motors and Toyota. However, the auto giant occasionally outsells Toyota in shorter periods (most recently, during the summer months of 2009). By the end of 2009, Ford was the third largest automaker in Europe (behind Volkswagen and PSA Peugeot Citroën). Ford is the seventh-ranked overall American-based company in the 2008 Fortune 500 list, based on global revenues in 2008 of $146.3 billion. In 2008, the company produced 5.532 million automobiles and employed about 213,000 employees at around 90 plants and facilities worldwide. During the automotive crisis, Ford''''s worldwide unit volume dropped to 4.817 million in 2009. Despite the adverse conditions, Ford ended 2009 with a net profit of $2.7 billion. Starting in 2007, Ford received more initial quality survey awards from J.D. Power and Associates than any other automaker. Five of Ford''''s vehicles ranked at the top of their categories and fourteen vehicles ranked in the top three. Today, Ford Motor Company manufactures automobiles under several names including Lincoln and Mercury in the United States. Ford plans to discontinue the Mercury brand at the end of 2010.\r\n\r\nFord has major manufacturing operations in Canada, Mexico, the United Kingdom, Germany, Turkey, Brazil, Argentina, Australia, the People''''s Republic of China, and several other countries, including South Africa where, following divestment during apartheid, it once again has a wholly owned subsidiary. Ford also has a cooperative agreement with Russian automaker GAZ.\r\n\r\nFord India is currently the 8th largest car maker in India after Maruti Suzuki, Hyundai, Tata Motors, Mahindra, Chevrolet, Honda and Toyota. Ford India began production in 1998 with its Ford Escort model, which was later replaced by locally produced Ford Ikon in 2001. It has since added Fusion, Fiesta, Mondeo and Endeavour to its product line. In India all Ford cars are made at Ford''''s Rs. 1700 crore integrated manufacturing plant at Maraimalai Nagar, 45 kms. from Chennai. The plant, equipped with advanced manufacturing technology from Ford, covers 350 acres, provides employment to about 2,000 people directly and many more thousands indirectly and has a capacity to manufacture upto 100,000 vehicles per annum. Ford is a 6-Sigma company. Ford India discontinued Escort, Mondeo and Fusion, however, they continue to sell Ikon, Endeavour, Fiesta and Figo today.\r\n\r\nOn 9 March 2010, Ford Motor Co. launched its first made-for-India compact car the Figo. Starting at Rs. 349,900 ($7,690), the Figo is Ford''''s first car designed and priced for the mass Indian market. As of July 2010, Ford India Private Limited (FIPL) has 167 dealerships across 97 cities in 21 states and 3 Union Territories of India. The company plans to expand to 200 dealerships by the end of 2010.');
INSERT INTO `brand` (`brandid`, `brandname`, `brandimage`, `decs`) VALUES
(1003, 'mercedes', 'data:image/jpeg;base64,', 'Mercedes-Benz entered the Indian market in 1994 as Daimler. After Daimler mergered with Chrysler, the Indian company was renamed as DaimlerChrysler India Private Ltd. In 2007, when Daimler sold out its shares in Chrysler, the company was renamed as Daimler AG and the Indian company was called Mercedes-Benz India.\r\n\r\nMercedes-Benz India signed a joint-venture with Tata Motors and launched the E220 officially in India. Mercedes-Benz and Tata Motors (then known as Telco) had struck a deal way back in 1954 to jointly manufacture medium commercial vehicles. All the Mercedes-Benz passenger cars were assembled at Tata Motors Pimpri plant. This plant was utilised by the German manufacturer to assemble and paint their cars. Tata Motors, however sold off its entire stake in the company to Mercedes-Benz India in 2000-01.\r\nMercedes-Benz Research and Development India (MBRDI):\r\n\r\nMercedes-Benz even has a research and development centre (MBRDI) in Bangalore in India.MBRDI had eight employees in 1996 and now the count has got up to 367. MBRDI today is the largest research centre for the company based outside Germany and contributes in the areas of Computer Simulation (CAE), Design (CAD), Electrical/Electronics and IT-Services.\r\nManufacturing plant in Chakan:\r\n\r\nMercedes-Benz India formally inaugurated its new manufacturing plant in Chakan, Pune in February 2009. The new facility was completed within 13 months from the start of construction -- among the fastest green-field projects to be created. With an area of 100 acres of land and independent assembly facilities for passenger cars and commercial vehicles, the infrastructure was created to address future expansion needs, underscoring the long-term growth plans of the company in India. While the plant was designed to manufacture the current local production portfolio of the Mercedes-Benz C-, E-, and S-Class, it is also flexible enough to accommodate additional production of other models from the Mercedes-Benz model range on the same assembly line, if required by future market demand.\r\nCSR activity:\r\n\r\nIn August 2003, DaimlerChrysler India with Central Salt and Marine Chemicals Research Institute (CSMCRI) and the University of Hohenheim as partners started ''''The Jatropha Biodiesel Project''''. The project is partly funded by DEG (Deutsche Investitions Entwicklungsgesellschaft). Since 2004, the Jatropha Biodiesel has generated community-wide support and interest towards alternate energy and Biodiesel. The project also included field-tests with Mercedes-Benz cars powered by pure (unblended) Biodiesel across nine states in India in 2004. This was followed by the cold weather high altitude tests of the Biodiesel cars across KhardungLa- the highest motorable road in the world and also across the frozen Himalayan terrains in 2005.\r\n');
INSERT INTO `brand` (`brandid`, `brandname`, `brandimage`, `decs`) VALUES
(1004, 'chevrolet', 'data:image/jpeg;base64,', 'Founded by Louis Chevrolet and ousted GM founder William C. Durant on November 8, 1911, Chevrolet was acquired by General Motors in 1917. Actual design work for the first Chevy, the costly Series C Classic Six was drawn up by Etienne Planche, following the instructions of his old friend Louis. The first C prototype was ready months before Chevrolet was actually incorporated.\r\n\r\nChina became Chevrolet''''s third largest market, with sales 332,774 vehicles, behind only the United States and Brazil. It was time that the company trickled down to other parts of Asia. The launch of Chevrolet marked General Motors'''' success in India. It set foot in India with the launch of Optra in 2003. The car was well received by the Indian customers. Chevrolet later launched the SUV Tavera which too did well in the Indian Market. But their true success was a ''''Spark'''' of brilliance. With the launch of Chevrolet Spark, not only did the GM sales numbers shoot up, but they developed a sense of confidence in the Indian consumers.\r\n\r\nChevrolet is among the newest brands in India launched by GM''''s India operations. Until June 6, 2003 (the official birthday of Chevrolet), GM India (which was originally a joint venture with Hindustan Motors) sold the Opel Corsa, Astra, and the Vectra. The Corsa and Astra were built at a plant in Halol, Gujarat.\r\n\r\nSince then, Chevrolet currently sells Cruze, Spark, Optra, Aveo, Tavera, Captiva, SRV (now discontinued) , Beat and Aveo U-VA cars in India. The Chevrolet Forester, a rebadged Subaru, was imported directly from Fuji Heavy Industries in Japan until 2005. The Optra and Tavera are built at the Halol plant. The Chevrolet launched in India the Captiva SUV. The latest models launched by Chevrolet are the Beat and the Cruze. Except for SRV, which we believe was launched ahead of its time, almost all Chevrolet cars are well accepted by Indians.\r\n\r\nChevrolet''''s brand success in India can be measured with the fact that; even General Motors'''' bankruptcy in the US did not hamper their sales in India. In fact, the bankruptcy had no impact on the Indian operations. Today, Chevrolet sells its cars through 150+ dealers in more than 120 cities in India.\r\n\r\nSince then, there was no looking back for Chevrolet in India. In 2009, Chevrolet launched the Cruze which has been the best-seller in its class. Chevrolet launched the Beat in 2010 only to increase its market share significantly. Chevrolet''''s premium SUV, Captiva too has been a strong player in its segment. The all Korean car has caught the attention of many Indians. The Chevrolet Aveo, Aveo UVA and the Optra have not been able to contribute much to the overall sales.\r\n\r\nGeneral Motors manufactures its cars from its Halol and Talegaon plants. Chevrolet''''s Halol plant has an annual capacity of 75000 units while the relatively new Talegaon plant has a manufacturing capacity of 10000 units. Chevrolet plans to double the manufacturing capacity by the end of 2010. Having now understood the Indian customer''''s mindset, Chevrolet has plans to bring in a few more cars to India.\r\n\r\nThe Chevrolet brand is currently undergoing a product restructuring in North America along with all other GM brands in order to fit into the parent company''''s turnaround efforts and to rebuild GM. General Motors has recently been in development to make more fuel efficient Chevrolet branded vehicles in order to compete with companies like Toyota and Honda. The Monte Carlo, discontinued in 2007, is said to be replaced by the Camaro, also a coupe. At the 2009 Detroit Auto Show, the production version of the Chevrolet Spark was displayed under the nameplate of Spark. General Motors announced that the Spark would go into production in the US. Along with the Spark , General Motors will introduce two more models: the plug-in hybrid 2011 Chevrolet Volt; and the 2011 Chevrolet Cruze, successor to the Cobalt.');

